import axios from "axios";
const PUBLICKEY = "cb68fc2ec155c195822ef51f03beb395";
const PRIVATEKEY = "12ae1f4be3a7ee1916245e66d313f38211fb9302";
const HASH = "1" + PUBLICKEY+PRIVATEKEY
const BASEURL = "http://gateway.marvel.com/v1/public/comics?ts=1&apikey="+PUBLICKEY+"&hash="+HASH

export default {
  search: function() {
    return axios.get(BASEURL);
  }
};
